import React from 'react'
import mapStateToProps from './ot'
import {lePinchoElCarnal} from '../../store/prueba/action'
import { connect } from 'react-redux'

const Prueba = ({lePinchoElCarnal, mapStateToProps}) =>{
    
    return(
        <div>
            <button onClick={()=>lePinchoElCarnal(mapStateToProps())}>Pinchale aqui carnal!!</button>
        </div>
    )
}

export default connect(null, {lePinchoElCarnal})(Prueba)
